import React from "react";
import { useSelector, useState, useDispatch } from "react";

Form = (props) => {
  const done = useSelector((state) => state.todos.done);
  console.log(done);
  return (
    <div>
      <input></input>
      <input></input>
      <button>추가하기</button>
    </div>
  );
};

export default Form;
